import * as React from "react";
import { Route, Switch } from "react-router-dom";
import Profile from '../components/Profile';
import Main from '../components/Main';
import Login from '../components/Login';
import About from '../components/About';
import AppliedRoute from "../components/AppliedRoute";


const Routes = ({ childProps }) => (
  <Switch>
    <AppliedRoute exact path="/" exact component={Main} props={childProps}/>
    <AppliedRoute exact path="/profile" component={Profile} />
    <AppliedRoute exact path="/login" component={Login} props={childProps} />
    <AppliedRouteRoute exact path="/about" component={About} />
  </Switch>
);

export default Routes;
